import React from 'react';
import AboutData from './aboutData';


class AboutInner extends React.Component{
  render(){
    return(
      <div id="contentabout" className="container-fluid">
           <div className="line"></div>
           <h1>How it works?</h1>
           <h6>Step by step</h6>
           {AboutData.map((item)=>{
             return(
               (("text8" in item)==1)?
               (<ul>
                 <li>{item.text1}</li>
                 <li>{item.text2}</li>
                 <li>{item.text3}</li>
                 <li>{item.text4}</li>
                 <li>{item.text5}</li>
                 <li>{item.text6}</li>
                 <li>{item.text7}</li>
                 <li>{item.text8}</li>
               </ul>)
             :
           null
             )})}
      </div>
    )
  }
}
export default AboutInner
